    "promoterInfo": "This 4-hour co-ed clinic is the foundation of everything else you’ll learn on the bike.  You’ll learn about balance and weight distribution and how that affects your ability to ride your bike safely and confidently.  Learn skills like riding with no hands, emergency stops, and how to look behind you while holding your line, how to steer, and counter-steer.  After just four hours, you’ll be a better bike handler and have much more fun on the bike. ",
